import { BrowserRouter, Route, Routes } from "react-router-dom";
import Register from "./Components/accounts/Register";
import Login from "./Components/accounts/Login";

function App() {
  return (
    <BrowserRouter>
        <div className="">
          <Routes>
        <Route 
                path="/" 
                element={<Login />} 
        />
        <Route 
                path="/login" 
                element={<Login />} 
        />
        <Route 
                path="/register" 
                element={<Register />} 
        />
        </Routes>
        </div>
      </BrowserRouter>
